import './App.css';

import Nav from './components/Nav';
import Home from './components/Home';

function App() {
  return (
    <Router>

      <Nav />
      <Routes>
        <Route exact path='/' element={<Home/>} />
      </Routes>
    </Router>
  );
}

export default App;
